崩溃报告提到：
Caused by: java.lang.NoSuchMethodError: net.minecraftforge.common.util.EnumHelper.addArmorMaterial(Ljava/lang/String;I[II)Lnet/minecraft/item/ItemArmor$ArmorMaterial;
参考net.minecraftforge.common.util.EnumHelper.addArmorMaterial的源代码：public static ArmorMaterial addArmorMaterial(String name, String textureName, int durability, int[] reductionAmounts, int enchantability, SoundEvent soundOnEquip, float toughness)
    {
        return addEnum(ArmorMaterial.class, name, textureName, durability, reductionAmounts, enchantability, soundOnEquip, toughness);
    }复制代码
我们可以看到实际上的方法参数列表并不是(String,int,int[],int)，因此造成崩溃。

目前最方便的办法是将神秘时代（神秘时代6Thaumcraft-1.12.2-6.1.BETA26.jar）删除；如果一定要保留这个Mod的话，请考虑使用Forge2768。
Forge 2768下载地址：https://files.minecraftforge.net ... 8-installer-win.exe

如果对您的问题有所帮助，请及时采纳。
